			shellScript = "#!/bin/sh\nset -eu\n\nPACKAGE_NAME=Card\nAPP=${PACKAGE_NAME}.app\nAPPLICATION=${BUILT_PRODUCTS_DIR}/${PACKAGE_NAME}.app\nDEST=${SRCROOT}/${PACKAGE_NAME}.dmg\nARCHIVE_PRODUCTS_PATH=${HOME}/Library/Developer/Xcode/Archives\nARCHIVE_APP_PATH=`ls -t ${ARCHIVE_PRODUCTS_PATH} | egrep '\\d{1,4}-\\d{1,2}-\\d{1,2}' | sed 1q | awk '{print $1}'`\nNEW_ARCHIVE=$(ls -t ${ARCHIVE_PRODUCTS_PATH}/${ARCHIVE_APP_PATH} | perl -ne 'print if m/(.*)xcarchive/;' | sed 1q)\n\ncd .\n[ -e ${BUILT_PRODUCTS_DIR}/dest ] && rm -rf ${BUILT_PRODUCTS_DIR}/dest\n\nif [[ ! -e ${BUILT_PRODUCTS_DIR}/dest ]]; then\nmkdir ${BUILT_PRODUCTS_DIR}/dest\nmkdir ${BUILT_PRODUCTS_DIR}/dest/.background\nfi\n\ncp -r \"${ARCHIVE_PRODUCTS_PATH}/${ARCHIVE_APP_PATH}/${NEW_ARCHIVE}/Products/Applications/${PACKAGE_NAME}.app\" \"${BUILT_PRODUCTS_DIR}/dest/\"\ncp ${APPLICATION}/Contents/Resources/bg.png ${BUILT_PRODUCTS_DIR}/dest/.background\nrm -rf ${BUILT_PRODUCTS_DIR}/dest/Applications\n\nhdiutil create -ov -srcfolder ${BUILT_PRODUCTS_DIR}/dest -fs HFS+ -format UDRW -imagekey zlib-level=9 -volname ${PACKAGE_NAME} ${BUILT_PRODUCTS_DIR}/pack.temp.dmg\ndevice=$(hdiutil attach -readwrite -noverify -noautoopen ${BUILT_PRODUCTS_DIR}/pack.temp.dmg | egrep '^/dev/' | sed 1q | awk '{print $1}')\n\nBGPICT=bg.png\n\n[ -e ${BUILT_PRODUCTS_DIR}/${PACKAGE_NAME}.dmg ] && rm -f ${BUILT_PRODUCTS_DIR}/${PACKAGE_NAME}.dmg\n\ncd ${BUILT_PRODUCTS_DIR}\necho '\ntell application \"Finder\"\ntell disk \"'${PACKAGE_NAME}'\"\nopen\nset current view of container window to icon view\nset toolbar visible of container window to false\nset statusbar visible of container window to false\nset the bounds of container window to {400, 50, 816, 633}\nset theViewOptions to the icon view options of container window\nset arrangement of theViewOptions to not arranged\nset icon size of theViewOptions to 80\nset background picture of theViewOptions to file \".background:'${BGPICT}'\"\nmake new alias file at container window to POSIX file \"/Applications\" with properties {name:\"Applications\"}\nset position of item \"'${APP}'\" of container window to {213, 230}\nset position of item \"Applications\" of container window to {213, 480}\nupdate without registering applications\ndelay 5\nclose\nend tell\nend tell\n' | osascript\necho 'do shell script \"chmod -Rf go-w /Volumes/${PACKAGE_NAME}\" with administrator privileges' | osascript\nsync\nsync\nhdiutil detach ${device}\nhdiutil convert ${BUILT_PRODUCTS_DIR}/pack.temp.dmg -format UDZO -imagekey zlib-level=9 -o ${DEST}\nrm -f ${BUILT_PRODUCTS_DIR}/pack.temp.dmg\nrm -rf ${BUILT_PRODUCTS_DIR}/dest\nexit 0";
